import React, { useState, useEffect } from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import CardActionArea from '@mui/material/CardActionArea';
import InteviewPortal from "./InteviewPortal";
import axios from 'axios';

const DashBoard = () => {
  const [catagoryTotal, setCatagoryTotal] = useState(0);
  const [subcatagoryTotal, setsubCatagoryTotal] = useState(0);
  const [qandaTotal, setQandATotal] = useState(0);
  const [selectedCard, setSelectedCard] = useState(0);

  // Category Count
  const cattotalData = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/category/count', {
        headers: {
          Authorization: "your_token_here",
        },
      })
      .then((res) => setCatagoryTotal(res.data.data))
      .catch((err) => console.log(err));
  };

  // Subcategory Count
  const subcattotallData = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/subcategory/count', {
        headers: {
          Authorization: "your_token_here",
        },
      })
      .then((res) => setsubCatagoryTotal(res.data.data))
      .catch((err) => console.log(err));
  };

  // Questions/Answers Count
  const qatotalData = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/questions/count', {
        headers: {
          Authorization: "your_token_here",
        },
      })
      .then((res) => setQandATotal(res.data.data))
      .catch((err) => console.log(err));
  };

  useEffect(() => {
    cattotalData();
    subcattotallData();
    qatotalData();
  }, []);

  const cards = [
    { id: 1, title: 'Total Category', description: catagoryTotal },
    { id: 2, title: 'Total Sub Category', description: subcatagoryTotal },
    { id: 3, title: 'Total Q / A', description: qandaTotal },
  ];

  return (
    <InteviewPortal>
      <Box
        sx={{
          width: '100%',
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill, minmax(min(300px, 100%), 1fr))',
          gap: 2,
        }}
      >
        {cards.map((card, index) => (
          <Card
            key={card.id}
            sx={{
              borderRadius: 3,
              boxShadow: selectedCard === index ? 6 : 3,
              background: selectedCard === index ? '#e3f2fd' : '#ffffff',
              transition: 'all 0.3s ease-in-out',
            }}
          >
            <CardActionArea
              onClick={() => setSelectedCard(index)}
              sx={{
                height: '100%',
                '&:hover': {
                  backgroundColor: '#bbdefb',
                },
              }}
            >
              <CardContent
                sx={{
                  height: '100%',
                  textAlign: 'center',
                  padding: 4,
                }}
              >
                <Typography
                  variant="h5"
                  component="div"
                  sx={{
                    fontWeight: 600,
                    color: '#0d47a1',
                    mb: 2,
                    fontFamily: `'Segoe UI', Tahoma, Geneva, Verdana, sans-serif`,
                  }}
                >
                  {card.title}
                </Typography>
                <Typography
                  variant="h2"
                  sx={{
                    color: '#1565c0',
                    fontWeight: 700,
                    fontFamily: `'Poppins', sans-serif`,
                  }}
                >
                  {card.description}
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        ))}
      </Box>
    </InteviewPortal>
  );
};

export default DashBoard;
